import React, { Component } from "react";
import { Button } from "@mui/material";
function UploadImage() {
  return (
    <div>
      <Button variant="contained" component="label">
        Upload File
        <input type="file" hidden />
      </Button>
    </div>
  );
}

export default UploadImage;
